class Solution {

    /**
     * @param Integer $low
     * @param Integer $high
     * @param Integer $k
     * @return Integer
     */
    function numberOfBeautifulIntegers($low, $high, $k) {
        $count = 0;
        // Skip numbers not divisible by k to reduce iterations
        $start = $low % $k === 0 ? $low : $low + ($k - $low % $k);

        for ($i = $start; $i <= $high; $i += $k) {
            if ($this->hasEqualEvenOddDigits($i)) {
                $count++;
            }
        }
        return $count;
    }

    private function hasEqualEvenOddDigits($num) {
        $digits = array_count_values(str_split($num));
        $even = $odd = 0;
        foreach ($digits as $digit => $count) {
            if ($digit % 2 === 0) {
                $even += $count;
            } else {
                $odd += $count;
            }
        }
        return $even == $odd;
    }
}
